user_x_has_been_unsuspended:"L'usuari %{user} ha estat eliminat de la llista de suspesos",the_world_is_full_of_interesting_places:"El món està ple de llocs interessants, cadascun amb les seves formes de vida rares i meravelloses. Algunes es troben a l'altre costat del món, i d’altres són molt a la vora. Llocs %{site_name} et permet buscar vida en qualsevol racó del planeta. Comença a explorar!",the_world_is_full_of_interesting_places_short:"El món està ple de llocs interessants, cadascun amb les seves formes de vida rares i meravelloses. Algunes es troben a l'altre costat del món, i d’altres són molt a la vora",there_is_no_wikipedia_page_matching:"No hi ha pàgines a Viquipèdia coincidents",there_isnt_a_wikipedia_article_titled_x_html:"A Viquipèdia no hi ha cap article que tingui relació amb el nom '%{x}. T’agradaria <a href='http://en.Viquipèdia.org/wiki/%{x}'>crear-ne</a> un?",there_isnt_wikipedia_article_perhaps:"No hi ha pàgines a Viquipèdia coincidents",there_merge_problems_with_the_merge:"Hi ha hagut problemes en intentar combinar els llocs: %{merged_errors}",there_was_a_problem_saving_your_identification:"Hi ha hagut un problema en desar la teva identificació: %{error}",there_were_errors:"S’han produït errors.",there_were_problems_adding_your_observation_to_this_project:"Hi ha hagut problemes en afegir les teves observacions al projecte: %{@project_observation}",there_were_problems_importing_that_place:"Hi ha hagut problemes en importar aquest lloc: %{place_error}",there_were_some_problems_saving_this_observation:"Hi ha hagut problemes en desar aquesta observació",there_were_some_problems_saving_those_colors:"Hi ha hagut problemes en desar aquests colors: %{error}",there_were_some_problems_with:"Hi ha hagut problemes amb el teu arxiu CSV.  Torna a revisar les files errònies. És possible que el problema hagi estat nostre. Si és així, si us plau, fes-nos-ho saber.",there_were_some_problems_with_fields:"Hi ha hagut problemes amb els següents camps",theres_also:"també hi ha",these_are_items_people_on:"Són continguts que la gent ha introduït com a advertència per a l’administració. Els continguts brossa s’esborraran i  l’usuari que els va introduir hauria de ser suspès (vés a la pàgina del seu perfil i a la part inferior esquerra selecciona l'enllaç Suspèn usuari perquè ja no pugui entrar al lloc). Els continguts de tipus il·legal, enganyós, racista, xenòfob, etc., s'han d'esborrar i s'han de respondre amb un comentari correcte. Les persones que repeteixin aquests comentaris s'han de comunicar a\n",these_are_taxa_that:"Són espècies o grups que %{site} no va poder afegir automàticament\na l'arbre taxonòmic. Tu pots afegir-los a l'arbre seleccionant\nl’enllaç \"editar\" i escollint una classe pare a la qual pertanyi.\nPer exemple, el pare d'<i>Homo sapiens</i> podria ser\n<i>Homo</i>. També pots cercar per espècie o grups que siguin\nsinònims i combinar-los.\n",these_arent_necessarily_relevant_to:"Aquestes observacions no necessàriament són rellevants per al projecte. Si us plau, comprova els",these_folks_kindly_volunteer_to:"Aquestes persones s'ofereixen voluntàries amablement per mantenir la taxonomia i resoldre altres problemes.",they_already_have_iNat_accounts:"...que ja tenen comptes %{site_name}",they_have_been_invited:"... ells ja han estat convidats.",third_person_possessive_singular:"%{noun} de %{object_phrase}","this":"aquest",this_is_a:"Aquesta és una",this_is_a_cached_summary_based_on:"Això és un resum de memòria cau d'aquest tàxon basat en el teu",this_is_a_life_list_of:"Això és una llista de vida de",this_is_a_more_convenient_way_to_find_a_taxon_id:"Aquesta és la via més convenient per trobar l'identificador de l'espècie o grup. Aquest és l'identificador de l'espècie o grup que quedarà desat. Aquesta cerca només funciona per a espècies o grups actius.",this_is_more_convenient_way_find_parent:"Aquesta és una manera més convenient de trobar un identificador pare. L'identificador pare és el que realment queda desat.","this_list_is_empty!":"Aquesta llista està buida!",this_list_only_accepts_taxa_that_are:"Aquesta llista només accepta tàxons que són",this_observation_has_been_incorporated_into_the_following_external_websites:"Aquesta observació s’ha incorporat als següents llocs web",this_observation_lies_outside_the:"Aquesta observació està fora del rang que %{site_name} té per a aquesta espècie. Això significarà que o bé el rang d’%{site_name} o la identificació són incorrectes, o que es tracta d’una ocurrència incorrecta o d’una expansió del rang.",this_photo_is_already_associated:"Aquesta foto ja està associada amb una de les teves observacions.",this_place_has_no_check_list:"Aquest lloc no té llista de comprovació, per tant, no hi ha guia",this_species:"aquesta espècie",this_species_has_no_colors:"Aquesta espècie no té colors! Ajuda a millorar les cerques d'espècies dient-nos de quin color és l’espècie!",this_taxon_change_has_been_commited:"<strong>Aquest canvi de taxonomia en l'espècie o grup s’ha desat!</strong> Si us plau, no editis l'espècie o grup. Pots editar els altres camps.",this_taxon_concept_is_inactive:"aquesta espècie o grup està inactiu/va",this_taxon_has_no_default_photo:"Aquest tàxon no té foto per defecte!",this_taxon_is_inactive_this_means:"Aquest tàxon està <strong>inactiu</strong>. Això significa que els administradors d’%{site_name} l’han reemplaçat per un concepte més actualitzat.\n",this_taxon_name_was_originally_imported:"Aquest nom de tàxon es va importar originàriament d'un proveïdor de noms extern",this_taxon_was_originally_imported_from:"Aquest tàxon es va importar originàriament d'un proveïdor de noms extern",this_tool_is_experimental:"Aquesta eina està encara en desenvolupament, així que, si us plau",this_tool_will_add_tags:"eina. Aquesta eina agrega etiquetes a les teves fotos de tots els noms comuns i científics del tàxon que has observat i dels noms dels seus ancestres. I si la teva observació és d'un",this_will_re_apply_all_list_rules:"S’aplicaran novament totes les normes de la llista als tàxons, per exemple, per rebutjar tàxons que no estan dins el tàxon de la llista de vida o dins el rang seleccionat. No agregarà cap tàxon. Aquesta acció pot trigar uns minuts.",this_will_try_to_add_tags_to_your_flickr:"Així es mirarà d’afegir etiquetes a les teves fotos de Flickr. Vols continuar?",this_will_update_all_last_observations:"Això actualitzarà totes les observacions recents i afegirà nous tàxons de",those_are_the_basics_of:"Aquestes són les bases per afegir observacions! Pots fer moltes altres coses, com ara buscar i filtrar les teves observacions o modificar-les com a grup, però això hauria de ser autoexplicatiu.",those_observations_no_longer_exist:"Aquestes observacions ja no existeixen.",threatened:"amenaçat",thu:"Dj.",time:{am:"matí",formats:{day_month_year:"%d %b. %Y","default":"%d %b %Y %H:%M:%S %Z","long":"%d de %B de %Y",observed_at:"a les %I:%M %p %Z",rfc:"%d %B %Y","short":"%d/%m/%Y"},pm:"tarda"},time_:"hora",time_ago:"fa %{time}",title:"títol",titled_favorites_and_the_most_recent_additions:'etiquetats "Preferits" i les addicions més recents apareixeran en aquest espai.',to:"a",to_:"de",to_add_comments:"per afegir comentaris.",to_add_identifications:"per afegir identificacions.",to_add_ids:"per afegir identificacions",to_an:"a una",to_configure_your_widget:"per configurar el teu giny.",to_include_your_picassa_with_inat:"Per incloure les teves fotos de Picasa, fotos amb les teves observacions a %{site_name}, fes clic al botó de la dreta per vincular els dos comptes. T’enviarem a Google, on et preguntaran si autoritzes aquesta connexió",to_tag_your_flickr_from_here:"per etiquetar les teves fotos de Flickr des d'aquí sense retallar i enganxar.",to_the_bat_cave:"A la Baticova!",to_update:"actualització",to_updates:"actualitzacions",today:"Avui",too_many_observations_csv:"Tens massa observacions! Només podem incloure les primeres %{max_rows} observacions de cada arxiu CSV",tools:"Eines",top_5_identif